[breeze_cdn_integration]
option_value = <<<serialized>>> <array>
option_value["cdn-active"] = "0"
option_value["cdn-url"] = ""
option_value["cdn-content"] = <array>
option_value["cdn-content"][0] = "wp-includes"
option_value["cdn-content"][1] = "wp-content"
option_value["cdn-exclude-content"] = <array>
option_value["cdn-exclude-content"][0] = ".php"
option_value["cdn-relative-path"] = "1"
autoload = "yes"
